import React from "react";
import classes from "./mainsec.module.css";
import base from "../images/basere.svg";
import base1 from "../images/base.svg";
import dollar from "../images/dollar.svg";
import dimond1 from "../images/dimond1.svg"
import dimond2 from "../images/dimond2.svg"
import logo from "../images/icon.png"
const Mainsec = () => {
  return (
    <div>
      <div className={classes.center}>
        <h1 className={classes.tx}>Crypto Tracker</h1>
        <hr className={classes.new1} />
      </div>
      <div>
        <div className="common-table"><table className="universal-table custom-cols-table  "><thead><tr><th className="left nowrap rank"><span className="table-column-title with-iconArrange">#<span className="icon-arrange " /></span></th><th className="left"><span className="table-column-title with-iconArrange">Name</span></th><th className="right"><span className="table-column-title with-iconArrange">24h Change</span></th><th className="right"><span className="table-column-title with-iconArrange">Price</span></th><th className="right show-desktop"><span className="table-column-title with-iconArrange">Price in BTC</span></th><th className="right show-desktop"><span className="table-column-title with-iconArrange">Market Cap</span></th><th className="right show-desktop"><span className="table-column-title with-iconArrange">Volume 24h</span></th><th className="right show-desktop"><span className="with-iconArrange"><span className="table-column-title">PRICE GRAPH (7D)</span></span></th><th className="right"><span className="with-iconArrange"><div className="table-value"><div className="jsx-2262109736 dropdown  show-desktop custom-cols-dropdown"><div className="jsx-2262109736 dropdown-placeholder"><span className="jsx-2095321675 icon-custom-column" /></div></div></div></span></th></tr></thead><tbody><tr className=" "><td title className="border left rank line-link"><a href="/en/coins/bitcoin/"><span className><span className="table-row">1</span></span></a></td><td title className="border left regular-weight-not-mobile coin-name-col qa-coin-name line-link"><a href="/en/coins/bitcoin/"><img className="table-image " src="https://static.coinstats.app/coins/Bitcoin6l39t.png" alt="Bitcoin, BTC" /><span className><span className="table-row">Bitcoin</span></span><span className="show-desktop additional-label"><span className="table-row"> • BTC</span></span></a></td><td title className="border right text-down regular-weight-not-mobile qa-coin-24h line-link"><a href="/en/coins/bitcoin/"><span className="change-row"><span className="icon-priceDown" /><span className="table-row">-3.76%</span></span></a></td><td title className="border right regular-weight-not-mobile qa-coin-price line-link"><a href="/en/coins/bitcoin/"><span className><span className="table-row">$58,324.97</span></span></a></td><td title className="border right show-desktop qa-coin-price-btc line-link"><a href="/en/coins/bitcoin/"><span className><span className="table-row">1.00000000</span></span></a></td><td title className="border right show-desktop qa-coin-market-cap line-link"><a href="/en/coins/bitcoin/"><span className><span className="table-row">$1.1T</span></span></a></td><td title className="border right show-desktop qa-coin-volume-24h line-link"><a href="/en/coins/bitcoin/"><span className><span className="table-row">$53.1B</span></span></a></td><td title className="border right show-desktop line-link"><a href="/en/coins/bitcoin/"><img className="table-image big" src="https://static.coinstats.app/sparks/bitcoin_1w.png" alt="Bitcoin, BTC" /><span className><span className="table-row" /></span></a></td><td title className="border left "><a href="/en/coins/bitcoin/"><span className><span className="table-row" /></span></a><div className="table-value"><div className="jsx-3397508174 table-more-menu"><div className="jsx-3397508174 more-icon-wrapper"><span className="jsx-3397508174 icon-more_small " /></div></div></div></td></tr><tr className=" "><td title className="border left rank line-link"><a href="/en/coins/ethereum/"><span className><span className="table-row">2</span></span></a></td><td title className="border left regular-weight-not-mobile coin-name-col qa-coin-name line-link"><a href="/en/coins/ethereum/"><img className="table-image " src="https://static.coinstats.app/coins/EthereumOCjgD.png" alt="Ethereum, ETH" /><span className><span className="table-row">Ethereum</span></span><span className="show-desktop additional-label"><span className="table-row"> • ETH</s